import React from "react";
import "../App.css";

function List(props) {
    var data = props.data;

    if (data.length > 0) {
        return (
            <div>
                <table>
                    <thead>
                        <tr>
                            <th>Name</th>
                            <th>Platform</th>
                            <th>Year</th>
                            <th>Global Sales</th>
                        </tr>
                    </thead>
                    <tbody>
                        {data.map((item) => (
                            <tr>
                                <td>{item.Name}</td>
                                <td>{item.Platform}</td>
                                <td>{item.Year}</td>
                                <td>{item.Global_Sales}</td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            </div>
        );
    } else {
        return null;
    }
}

export default List;
